import React from 'react';
import ReactDOM from 'react-dom/client'; // 'react-dom/client' 사용 (React 18)
import './index.css'; // 기본 CSS 파일을 추가
import App from './App';
import CalendarComponent from './Calendar'; // CalendarComponent 가져오기

// React 18 버전에서 사용하는 새 방식의 렌더링
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
    <CalendarComponent /> {/* 캘린더 컴포넌트 추가 */}
  </React.StrictMode>
);
